SESSION_KEY_Wave_obj_1.query:
q = load "WaveChangeEA";
q = filter q by date('TIMESTAMP_DERIVED_Year', 'TIMESTAMP_DERIVED_Month', 'TIMESTAMP_DERIVED_Day') in {{column(time_1.selection, ["value1"]).asObject()}};
q = filter q by 'TYPE' == "dashboard";
--q = filter q by ('User_Profile_Name' != "System Administrator" || 'User_Profile_Name' is null);
q = group q by ('SESSION_KEY', 'User_Name', 'Wave_objects_Label');
q = foreach q generate 'SESSION_KEY' as 'SESSION_KEY', 'User_Name' as 'User_Name', unique('Wave_objects_Id') as 'unique_Wave_objects_Id', 'Wave_objects_Label' as 'Wave_objects_Label';
q = group q by ('User_Name', 'Wave_objects_Label');
q = foreach q generate  'User_Name' as 'User_Name', 'Wave_objects_Label' as 'Wave_objects_Label', sum('unique_Wave_objects_Id') as 'Count';
q = order q by ('User_Name' asc, 'Count' desc);
q = limit q 2000;

